import logo from './images/meoimeoi_logo_co.png';
import LinkSection from './LinkSection';
import LinkOptions from './LinkOptions';
import { useState } from 'react';

import './meoimeoi-light-mode.css';

function Meoi() {
  const [selected, setSelected] = useState([]);
  function selectLink(option) {
    setSelected(option);
  }
  return (
    <div className="Meoi">
      <header className="Meoi-header">
        <img src={logo} className="Meoi-logo" alt="logo" />
        <LinkSection section={LinkOptions.development} onClick={() => this.selectLink(LinkOptions.development)}/>
        <LinkSection section={LinkOptions.about} onClick={() => this.selectLink(LinkOptions.about)}/>
        <LinkSection section={LinkOptions.development} onClick={() => this.selectLink(LinkOptions.development)}/>
        <LinkSection section={LinkOptions.development} onClick={() => this.selectLink(LinkOptions.development)}/>

      </header>
    </div>
  );
}

export default Meoi;
